import './App.css';
import Reading from './Home/Components/Reading/Reading';
import Navbar from './Home/Components/Reading/News/Navbar';
import News from './Home/Components/Reading/News/News';
import HomePage from './Home/HomePage';
import { BrowserRouter, Routes, Route } from "react-router-dom";
// import Sidebar from './component/Sidebar';
function App() {
  return (
    <div>

      <BrowserRouter>
        <Routes>
          <Route path='/' element={<HomePage />}></Route>
          <Route path='/HomePage' element={<HomePage />}></Route>
          <Route path='/Reading' element={<Reading />}></Route>
          <Route path='/Reading/News' element={<News key="general" pageSize={9} country="in" category="general" topic="General" />}>}>
            <Route path="/" element={<News key="general" pageSize={9} country="in" category="general" topic="General" />}></Route>
            <Route path="/business" element={<News key="business" pageSize={9} country="in" category="business" topic="Business" />}></Route>
            <Route path="/entertainment" element={<News key="entertainment" pageSize={9} country="in" category="entertainment" topic="EntertainMent" />}></Route>
            <Route path="/general" element={<News key="general" pageSize={9} country="in" category="general" topic="General" />}></Route>
            <Route path="/health" element={<News key="health" pageSize={9} country="in" category="health" topic="Health" />}></Route>
            <Route path="/science" element={<News key="science" pageSize={9} country="in" category="science" topic="Science" />}></Route>
            <Route path="/sports" element={<News key="sports" pageSize={9} country="in" category="sports" topic="Sports" />}></Route>
            <Route path="/technology" element={<News key="technology" pageSize={9} country="in" category="technology" topic="Technology" />}></Route>
          </Route>
        </Routes>
        {/* </div> */}
      </BrowserRouter>
    </div>
  );
}

export default App;








